r min/vår räkning inhämta all önskad information, inklusive men inte uteslutande amorteringsunderlag, hos angiven långivare om mina/våra lån med därtill hörande säkerhet samt ger Stabelo AB, eller av Stabelo AB utsedd tredje part, i uppdrag för min/vår räkning säga upp och lösa angivna lån.\\n\",{\"_14\":30,\"_16\":17,\"_18\":31},\"SUMMER.ABOUT\",\"Hoppas du har en fin sommar.\\nFyll i svaret så har du snart **0,20 procentenheter** rabatt på din bolåneränta i **12 månader**.\",{\"_14\":33,\"_16\":17,\"_18\":34},\"DOCUMENT_OVERVIEW.NO_DOCUMENTS\",\"Just nu har du inga dokument.\",{\"_14\":36,\"_16\":17,\"_18\":37},\"BUDID.APPLY_BUTTON\",\"Ansök om lånelöfte\",{\"_14\":39,\"_16\":17,\"_18\":40},\"PROPERTY_VALUATION_DESCRIPTION\",\"Ladda upp en värdering av bostaden.\\n\\t- Mäklarvärderingen ska vara skriftlig och utförd av en registrerad fastighetsmäklare eller en av Samhällsbyggarna licensierad värderingsman.\\n\\t- Vi beviljar endast bolån upp till ${ltvLimit} av bostadens värde.\\n\\t- Eventuell kostnad för värderingen står sökande för.\\n\\t- Mäklarvärderingen får inte vara äldre än 3 månader.\\n\\nDet går även bra att ladda upp ett överlåtelseavtal eller köpekontrakt om det inte är äldre än 3 månader.\",{\"_14\":42,\"_16\":17,\"_18\":43},\"BUDID.MISSING_COMMITMENT\",\"Lånelöfte saknas hos Stabelo.\\\\nAnsök digitalt och få svar direkt efter inskickad ansökan.\\\\n\\\\n\",{\"_14\":45,\"_16\":17,\"_18\":46},\"DISBURSEMENT_APPROVAL_FORM.DISBURSEMENT_ACCOUNT_INFORMATION\",\"Vid utbetalning av lån vill jag/vi att Stabelo AB sätter in pengar på mitt/vårt konto. Observera att vi endast kan använda ditt/ert egna konto.\",{\"_14\":48,\"_16\":17,\"_18\":49},\"CASE_LANDING_PAGE_APPLICANT.CONTENT\",\"####Det är dags att signera ditt bolån.\\nVi har nöjet att erbjuda er ett bolån och på denna sida kan du genomföra en digital signering av ditt nya bolån. Behöver ni tänka på saken har ni betänketid motsvarande tio (10) dagar från det att detta erbjudandet skickades till er.\\n\\nUnder tiden gäller villkoren som ﬁnns att läsa här. Efter betänketiden kan villkoren komma att förändras i enlighet med bankens interna regler, om till exempel förhållanden på marknaden ändras.\\n\\nOm ni accepterar villkoren ber vi er att gå igenom och signera de digitala dokumenten enligt informationen nedan. Översiktsmodulen ger dig nödvändig information genom processen.\\n\\nVid frågor är ni välkomna att kontakta oss på [010-410 35 00](tel:0104103500) eller [bolan@stabelo.se](mailto:bolan@stabelo.se)\\n\\nMed vänlig hälsning \\nStabelo AB\",{\"_14\":51,\"_16\":17,\"_18\":28},\"DISBURSEMENT_APPROVAL_FORM.PAYMENT_OF_CURRENT_LOANS_SHORT\",{\"_14\":53,\"_16\":17,\"_18\":54},\"AMORTIZATION_REQUIREMENT_BASIS.AMORTIZATION_REQUIREMENT_BASIS_DOCUMENT_MESSAGE\",\"Din begäran om amorteringsunderlag är nu behandlad och du kan ladda ner en kopia på ditt amorteringsunderlag nedan.\",{\"_14\":56,\"_16\":17,\"_18\":57},\"REFERRAL_APPLICATION_INFO\",\"**Så du vet! När du blir Stabelokund kan du sänka bolåneräntan för dig och dina kompisar**\\n\\n* Tipsa om Stabelo. Då får du och den du tipsat **${interest_rate_modifier} rabatt** på bolånet i ${interest_rate_modifier_duration}\\n* Du kan tipsa hur många du vill tills **du har 0% i ränta**\\n* Din kampanjkod hittar du på Mina sidor efter utbetalt lån\",{\"_14\":59,\"_16\":17,\"_18\":60},\"MORTGAGE_LETTER_FORM.TERMS_AND_CONDITIONS\",\"#### Lånevillkor\\n\\nLåntagaren bekräftar med sin underskrift att hon/han tagit del av, och förstått detta skuldebrev samt den information som Långivaren enligt Konsumentkreditlagen är skyldig att tillhandahålla, nämligen:  \\n\u003cbr\u003e\\nStandardiserat EU-faktablad med för motsvarande bolån, Långivarens ﬁnansieringskostnader samt vilka faktorer Långivaren tagit hänsyn till vid fastställande av den ränta som i skriftlig form bifogats erbjudandet om lånet.  \\n\u003cbr\u003e\\nLåntagaren bekräftar vidare att hon/han haft möjlighet att överväga erbjudandet om lånet i åtminstone tio dagar från och med den dagen som brevet har skickats.\\n\u003cbr\u003e\\n\u003cbr\u003e\\n\\n#### Låntagarens underskrift\\n\\nLåntagaren bekräftar genom undertecknandet av detta skuldebrev att Låntagaren tagit del av ovanstående information och de villkor som anges i skuldebrevet samt tillhörande bilagor, inklusive allmänna villkor.\\n\u003cbr\u003eLåntagaren pantförskriver genom undertecknandet av detta skuldebrev.\",{\"_14\":62,\"_16\":17,\"_18\":63},\"LOAN_AMOUNT_NOT_VALID.MESSAGE\",\"Låna från ${loan_min} upp till ${loan_max}\",{\"_14\":65,\"_16\":17,\"_18\":66},\"FAIR.ABOUT_SHORT\",\"**Tipsa andra, båda får rabatt**\\n\\nNär du är kund kan du också tipsa andra och då får både du och den du tipsat 0,20 procentenheters rabatt på bolåneräntan i 12 månader.\\n\\nDu kan tipsa hur många du vill tills du har **0 % i ränta!**\",{\"_14\":68,\"_16\":17,\"_18\":69},\"FAIR.ABOUT\",\"Med din rabattkod får du 0,20 procentenheters rabatt på din bolåneränta i 12 månader.\\n\\n**Tipsa andra, båda får rabatt**\\n\\nNär du är kund kan du också tipsa andra och då får både du och den du tipsat 0,20 procentenheters rabatt på bolåneräntan i 12 månader.\\n\\nDu kan tipsa hur många du vill tills du har **0 % i ränta!**\",{\"_14\":71,\"_16\":17,\"_18\":72},\"QUESTIONNAIRE_REQUEST.TITLE\",\"Uppdatering av kundkännedom\",{\"_14\":74,\"_16\":17,\"_18\":75},\"BUDID.PROPERTY_NOT_LOANABLE\",\"Ditt lånelöfte gäller inte för denna bostad.\\\\nKontakta vårt bolåneteam för mer information.\\\\n\\\\n\",{\"_14\":77,\"_16\":17,\"_18\":78},\"LTV_TOO_HIGH.DETAILS\",\"### Max belåningsgrad\\n\\nHos Stabelo får du låna högst ${ltv_limit} av bostadens värde.\\n\\n\\nExempel: För en bostad värd ${example_value} kan du ta ett bolån på max ${example_amount}.\\n\",{\"_14\":80,\"_16\":17,\"_18\":81},\"REFERRAL_BOX\",\"### Tipsa om Stabelo tills du har 0% i ränta\\n\\n* Du får **${interest_rate_modifier} rabatt** på ditt bolån i ${interest_rate_modifier_duration} för varje person du tipsat som blir kund.\\n* Den du tipsat
